    "selectAMenuDropBox": {                           "en": "Select a Menu,select move or copy. Watch out! A user must be active in the selected menu!", "de": "Wählen Sie ein Menü, wählen Sie „Verschieben“ oder „Kopieren“. Achtung! Im ausgewählten Menü muss ein Benutzer aktiv sein!", "ru": "Выберите меню, выберите перемещение или копирование. Осторожно! Пользователь должен быть активен в выбранном меню!", "pt": "Selecione um menu, selecione mover ou copiar. Atenção! Um usuário deve estar ativo no menu selecionado!", "nl": "Selecteer een menu, selecteer verplaatsen of kopiëren. Pas op! Er moet een gebruiker actief zijn in het geselecteerde menu!", "fr": "Sélectionnez un menu, sélectionnez déplacer ou copier. Attention! Un utilisateur doit être actif dans le menu sélectionné !", "it": "Seleziona un menu, seleziona sposta o copia. Attento! Un utente deve essere attivo nel menu selezionato!", "es": "Seleccione un menú, seleccione mover o copiar. ¡Cuidado! ¡Un usuario debe estar activo en el menú seleccionado!", "pl": "Wybierz menu, wybierz opcję przenieś lub skopiuj. Uważaj! Użytkownik musi być aktywny w wybranym menu!", "uk": "Виберіть меню, виберіть перемістити або скопіювати. Обережно! Користувач повинен бути активним у вибраному меню!", "zh-cn": "选择一个菜单，选择移动或复制。当心！用户必须在所选菜单中处于活动状态！"},
