    "setAck": {                                       "en": "Set ack flag",                                     "de": "Bestätigungsflag setzen",                          "ru": "Установить флаг подтверждения",                    "pt": "Definir sinalizador de confirmação",               "nl": "Bevestigingsvlag instellen",                       "fr": "Définir le drapeau de réception",                  "it": "Imposta il flag di riconoscimento",                "es": "Establecer indicador de confirmación",             "pl": "Ustaw flagę potwierdzenia",                        "uk": "Встановити прапор підтвердження",                  "zh-cn": "设置确认标志"},
    "setDynamicValue": {                              "en": "This allows you to write dynamic values ​​into data points. Simply make a call and then you can enter the value in the input field. RequestText: Text to request the value. Type: type of the value(boolean or number). ConfirmText: Text to confirm the value. ID: If you want to confirm from another State, enter the ID here.(This is optional)", "de": "Dadurch können Sie dynamische Werte in Datenpunkte schreiben. Einfach anrufen und dann den Wert in das Eingabefeld eingeben. RequestText: Text zum Anfordern des Werts. Typ: Typ des Werts (boolescher Wert oder Zahl). Bestätigungstext: Text zur Bestätigung des Werts. ID: Wenn Sie aus einem anderen Staat bestätigen möchten, geben Sie hier die ID ein. (Dies ist optional)", "ru": "Это позволяет записывать динамические значения в точки данных. Просто позвоните, а затем введите значение в поле ввода. RequestText: текст для запроса значения. Тип: тип значения (логическое или числовое). ConfirmText: текст для подтверждения значения. Идентификатор: Если вы хотите подтвердить из другого штата, введите здесь идентификатор. (Это необязательно).", "pt": "Isso permite gravar valores dinâmicos em pontos de dados. Basta fazer uma chamada e inserir o valor no campo de entrada. RequestText: Texto para solicitar o valor. Tipo: tipo do valor (booleano ou número). ConfirmText: Texto para confirmar o valor. ID: Se você deseja confirmar de outro estado, insira o ID aqui.(Isso é opcional)", "nl": "Hierdoor kunt u dynamische waarden in datapunten schrijven. U hoeft alleen maar te bellen en vervolgens kunt u de waarde in het invoerveld invoeren. RequestText: tekst om de waarde op te vragen. Type: type waarde (Boolean of getal). BevestigTekst: tekst om de waarde te bevestigen. ID: Als u vanuit een andere staat wilt bevestigen, voert u hier het ID in. (Dit is optioneel)", "fr": "Cela vous permet d'écrire des valeurs dynamiques dans des points de données. Passez simplement un appel et vous pourrez ensuite saisir la valeur dans le champ de saisie. RequestText : texte pour demander la valeur. Type : type de la valeur (booléen ou nombre). ConfirmText : texte pour confirmer la valeur. ID : Si vous souhaitez confirmer depuis un autre État, entrez l'ID ici. (Ceci est facultatif)", "it": "Ciò consente di scrivere valori dinamici in punti dati. Basta effettuare una chiamata e quindi inserire il valore nel campo di immissione. RequestText: testo per richiedere il valore. Tipo: tipo del valore (booleano o numerico). confirmText: testo per confermare il valore. ID: se desideri confermare da un altro Stato, inserisci qui l'ID (facoltativo)", "es": "Esto le permite escribir valores dinámicos en puntos de datos. Simplemente haga una llamada y luego podrá ingresar el valor en el campo de entrada. RequestText: Texto para solicitar el valor. Tipo: tipo del valor (booleano o número). ConfirmText: Texto para confirmar el valor. DNI: Si deseas confirmar desde otro Estado, ingresa aquí el DNI. (Esto es opcional)", "pl": "Umożliwia to zapisywanie wartości dynamicznych w punktach danych. Wystarczy wykonać połączenie, a następnie wprowadzić wartość w polu wejściowym. RequestText: Tekst żądania wartości. Typ: typ wartości (logiczna lub liczba). PotwierdźTekst: Tekst potwierdzający wartość. ID: Jeśli chcesz potwierdzić, że pochodzisz z innego stanu, wprowadź tutaj identyfikator. (jest to opcjonalne)", "uk": "Це дозволяє записувати динамічні значення в точки даних. Просто зателефонуйте, а потім можете ввести значення в поле введення. RequestText: текст для запиту значення. Тип: тип значення (логічне або числове). ConfirmText: Текст для підтвердження значення. ID: якщо ви хочете підтвердити з іншого штату, введіть тут ідентифікатор. (Це необов’язково)", "zh-cn": "这允许您将动态值写入数据点。只需拨打电话，然后您就可以在输入字段中输入值。 RequestText：请求值的文本。类型：值的类型（布尔值或数字）。确认文本：用于确认值的文本。 ID：如果您想从其他州确认，请在此处输入 ID。（这是可选的）"},
    "setID": {                                        "en": "Sets the value of the ID to the val, with ack(confirmed)", "de": "Setzt den Wert der ID auf den Wert, mit ack(bestätigt)", "ru": "Устанавливает значение идентификатора val с подтверждением (подтверждено).", "pt": "Define o valor do ID para val, com ack(confirmado)", "nl": "Stelt de waarde van de ID in op val, met ack(confirmed)", "fr": "Définit la valeur de l'ID sur le val, avec ack (confirmé)", "it": "Imposta il valore dell'ID su val, con ack(confirmed)", "es": "Establece el valor del ID en val, con ack(confirmado)", "pl": "Ustawia wartość identyfikatora na val, z potwierdzeniem (potwierdzone)", "uk": "Встановлює значення ідентифікатора як val з ack(confirmed)", "zh-cn": "将ID的值设置为val，带有ack（已确认）"},
