    "statusMenu": {                                   "en": "Queries the value of the ID and then replaces it with the value, so text can be written around it, it is also possible to use it more than one time in a row. The parameter true is a option to change Value by function change. You have to set it to false if you don´t change this value, but behind this there is another {status: ... request with change:true.", "de": "Fragt den Wert der ID ab und ersetzt ihn dann durch den Wert, sodass Text um ihn herum geschrieben werden kann. Es ist auch möglich, ihn mehrmals hintereinander zu verwenden. Der Parameter true ist eine Option zum Ändern des Werts durch Funktionsänderung. Sie müssen es auf false setzen, wenn Sie diesen Wert nicht ändern, aber dahinter steht eine weitere {status: ...-Anfrage mit change:true.", "ru": "Запрашивает значение идентификатора, а затем заменяет его значением, поэтому вокруг него можно писать текст, а также можно использовать его более одного раза подряд. Параметр true позволяет изменить значение путем изменения функции. Вам придется установить значение false, если вы не измените это значение, но за этим стоит другой запрос {status: ... с изменением: true.", "pt": "Consulta o valor do ID e depois o substitui pelo valor, para que possa ser escrito texto ao redor dele, também é possível utilizá-lo mais de uma vez seguida. O parâmetro true é uma opção para alterar o valor por alteração da função. Você deve defini-lo como falso se não alterar esse valor, mas por trás disso existe outro {status: ... solicitação com alteração: verdadeiro.", "nl": "Vraagt ​​de waarde van het ID op en vervangt deze vervolgens door de waarde, zodat er tekst omheen kan worden geschreven, het is ook mogelijk om deze meerdere keren achter elkaar te gebruiken. De parameter true is een optie om de waarde te wijzigen door een functiewijziging. Je moet het op false zetten als je deze waarde niet verandert, maar hierachter zit nog een {status: ... request with change:true.", "fr": "Interroge la valeur de l'ID puis la remplace par la valeur, afin que du texte puisse être écrit autour, il est également possible de l'utiliser plus d'une fois de suite. Le paramètre true est une option permettant de modifier la valeur par changement de fonction. Vous devez le définir sur false si vous ne modifiez pas cette valeur, mais derrière cela se trouve une autre requête {status: ... avec change:true.", "it": "Interroga il valore dell'ID e poi lo sostituisce con il valore, in modo che sia possibile scrivere del testo attorno ad esso, ed è anche possibile utilizzarlo più di una volta di seguito. Il parametro true è un'opzione per modificare il valore mediante modifica della funzione. Devi impostarlo su false se non cambi questo valore, ma dietro c'è un'altra richiesta {status: ... con change:true.", "es": "Consulta el valor del ID y luego lo reemplaza con el valor, para que se pueda escribir texto alrededor de él, también es posible usarlo más de una vez seguida. El parámetro verdadero es una opción para cambiar el valor mediante el cambio de función. Tienes que establecerlo en falso si no cambias este valor, pero detrás de esto hay otra solicitud {status: ... con cambio:true.", "pl": "Odpytuje wartość identyfikatora, a następnie zastępuje ją wartością, dzięki czemu można wokół niego napisać tekst, można go również użyć więcej niż raz z rzędu. Parametr true umożliwia zmianę wartości poprzez zmianę funkcji. Jeśli nie zmienisz tej wartości, musisz ustawić ją na false, ale za tym kryje się kolejne żądanie {status: ... ze zmianą:true.", "uk": "Запитує значення ідентифікатора, а потім замінює його значенням, тому навколо нього можна написати текст, його також можна використовувати кілька разів поспіль. Параметр true — це можливість змінити значення шляхом зміни функції. Ви повинні встановити значення false, якщо ви не змінюєте це значення, але за цим є інший {status: ... запит із change:true.", "zh-cn": "查询ID的值，然后将其替换为值，因此可以在其周围写入文本，也可以连续多次使用它。参数 true 是通过函数更改来更改值的选项。如果您不更改此值，则必须将其设置为 false，但在这后面还有另一个带有change:true 的 {status: ... 请求。"},
